package com.dilidili.of.entity;public class Partition extends BaseBean{	private long id;	private long count;	private Cover sub_icon;	private String area;	private String name;	public long getId() {		return this.id;	}	public void setId(long id) {		this.id = id;	}	public long getCount() {		return this.count;	}	public void setCount(long count) {		this.count = count;	}	public Cover getSub_icon() {		return this.sub_icon;	}	public void setSub_icon(Cover sub_icon) {		this.sub_icon = sub_icon;	}	public String getArea() {		return this.area;	}	public void setArea(String area) {		this.area = area;	}	public String getName() {		return this.name;	}	public void setName(String name) {		this.name = name;	}	public String toString() {		return "Partition [id = " + id + ", count = " + count + ", sub_icon = " + sub_icon + ", area = " + area + ", name = " + name + "]";	}}